import React, { Component } from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';

class Home extends Component {
    state = {
        "img": loslagos_1,
        clicked: false,
    }

    handleClick = () => {
        this.setState({ clicked: !this.state.clicked })
    }

    render() {
        return (
            <div class='/'>
                <h1>HOME </h1>
                <img
                    src={this.state.img}
                    onMouseEnter={() => {
                        this.setState({
                            "img": loslagos_2
                        })
                    }}

                    onMouseOut={() => {
                        this.setState({
                            "img": loslagos_1
                        }),
                         this.state.clicked(
                         <h2>holita</h2>)

                    }}
                />
            </div>
        )
    }
};

export default Home;
